import React from 'react'
import Navbar from 'react-bootstrap/Navbar';
// import Nav from 'react-bootstrap/Nav';
import {
    MDBIcon,
  } from 'mdb-react-ui-kit';
import { Nav } from 'react-bootstrap';

const NavbarS = () => {
  return (
    <>
      <Navbar collapseOnSelect expand='lg' light style={{ backgroundColor: '#e3f2fd' }}>
          <Navbar.Brand href='#'>
           <img
            src='https://upload.wikimedia.org/wikipedia/commons/5/5f/Amazon_Go_logo_%28black_letters_with_white_background%29.png'
            alt='imgage'
            style={{ width: '19px', height: '45px' }}
            // className='rounded-circle'
          />
          <span>.</span></Navbar.Brand>
          <Navbar.Brand href="#home">AmazonGo.com</Navbar.Brand>
          <Navbar.Toggle aria-controls='Responsive-navbar-nav'>
            <MDBIcon icon='bars' fas />
          </Navbar.Toggle>
          <Navbar.Collapse id='Responsive-navbar-nav'>
            <Nav className='me-auto'>
                <Nav.Link aria-current='page' href='/'>Home</Nav.Link>
                <Nav.Link href='/read'>Read</Nav.Link>
                <Nav.Link href='/update'>Update</Nav.Link>
                <Nav.Link href='/about'>About</Nav.Link>
                </Nav>
          </Navbar.Collapse>
      </Navbar>


      

    </>
  )
}

export default NavbarS;
